export default function SensorCard({ title, value, unit, icon, small = false }) {
    return (
        <div className={`sensor-card ${small ? "w-40" : "w-full"} p-3 rounded-lg shadow bg-white`}>
            {/* icon */}
            {icon && <div className="text-2xl mb-1">{icon}</div>}
            
            {/* title */}
            <div className="text-xs text-gray-500">{title}</div>
            
            {/* value + unit */}
            <div className="mt-2 text-2xl font-semibold">
                {value} <span className="text-base">{unit}</span>
            </div>
        </div>
    );
}
